import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 33.2-1817 Dedication of assets.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1817.md","filePath":"vacode/33.2-1817.md"}'),r={name:"vacode/33.2-1817.md"},n=i('<h1 id="§-33-2-1817-dedication-of-assets" tabindex="-1">§ 33.2-1817 Dedication of assets. <a class="header-anchor" href="#§-33-2-1817-dedication-of-assets" aria-label="Permalink to &quot;§ 33.2-1817 Dedication of assets.&quot;">​</a></h1><p>The responsible public entity shall terminate the private entity&#39;s authority and duties under this chapter on the date set forth in the interim or comprehensive agreement. Upon termination, the authority and duties of the private entity under this chapter shall cease, and the qualifying transportation facility shall be dedicated to the responsible public entity or, if the qualifying transportation facility was initially dedicated by an affected locality or public entity, to such affected locality or public entity for public use.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0855" target="_blank" rel="noreferrer">855</a>, § 56-572; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0647" target="_blank" rel="noreferrer">647</a>; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0504" target="_blank" rel="noreferrer">504</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0562" target="_blank" rel="noreferrer">562</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),o=[n];function s(l,c,d,h,f,p){return t(),a("div",null,o)}const u=e(r,[["render",s]]);export{g as __pageData,u as default};
